import { Link } from "react-router-dom";
import classes from './'

export default function Navigation(){
    return(
        <header>
            <nav>
                <ul>
                    <li><Link to='/'>Home</Link></li>
                    <li><Link to='/products'>Products</Link></li>
                </ul>
            </nav>
        </header>
    )
}
